import React from 'react';
import { BrowserRouter, Route, Link } from 'react-router-dom';
import StreamCreate from './streams/StreamCreate';
import StreamEdit from './streams/StreamEdit';
import StreamDelete from './streams/StreamDelete';
import StreamList from './streams/StreamList';
import StreamShow from './streams/StreamShow';

const App = () => {

  const linkList = [ StreamCreate, StreamEdit ];
  const links = linkList.map(list => (<Link to={list} />));
  console.log(links);

  return (
    <div>
      <BrowserRouter>
        <Route path="/" exact component={StreamList} />
        <Route path="/streams/new" exact component={this.props.links.to.name} />
        <Route path="/streams/edit" exact component={links} />
        <Route path="/streams/delete" exact component={links} />
        <Route path="/streams/show" exact component={links} />
      </BrowserRouter>
    </div>
  );
}

export default App;
